import { useContext } from "react";
import { CoursesContext } from "../Helpers/Context";

const personalInfo = () => {
    const { setCurrentPage } = useContext(CoursesContext);

    return (
        <>
            <button onClick={() => setCurrentPage("personalInfo")}>Change Password</button>
        </>
    );
};

export default personalInfo;
